INSERT INTO [MapNodeIndicators] ([MapNodeId], [IndicatorId], [Type], [RegionCategory], [FinanceSource], [BaseTotalValue], [BaseMenValue], [BaseWomenValue], [BaseQualitativeValue], [BaseYear], [TargetTotalValue], [TargetMenValue], [TargetWomenValue], [TargetQualitativeValue], [MilestoneTargetTotalValue], [MilestoneTargetMenValue], [MilestoneTargetWomenValue], [FinalTargetTotalValue], [FinalTargetMenValue], [FinalTargetWomenValue], [MeasureId], [DataSource], [ReportingFrequancy], [CommonBaseIndicator], [Description]) VALUES (601, 306, N'Table6', 1, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 89000.00, NULL, NULL, 220000.00, NULL, NULL, NULL, N'МОСВ, Проектни предложения', NULL, NULL, N'Етапната цел е определена предвид възможността до 2018 г. да се изпълняват проекти, които отговарят на регионалния подход и чието изпълнение може да започне преди края на 2016 г. Крайната цел е определена въз основа на предварителен анализ на инвестиционните нужди за привеждане в съответствие с Директива 98/83/ЕО на агломерации на територията на консолидиран оператор и отчита финансовия ресурс, заделен за такъв вид мерки по оста.')
INSERT INTO [MapNodeIndicators] ([MapNodeId], [IndicatorId], [Type], [RegionCategory], [FinanceSource], [BaseTotalValue], [BaseMenValue], [BaseWomenValue], [BaseQualitativeValue], [BaseYear], [TargetTotalValue], [TargetMenValue], [TargetWomenValue], [TargetQualitativeValue], [MilestoneTargetTotalValue], [MilestoneTargetMenValue], [MilestoneTargetWomenValue], [FinalTargetTotalValue], [FinalTargetMenValue], [FinalTargetWomenValue], [MeasureId], [DataSource], [ReportingFrequancy], [CommonBaseIndicator], [Description]) VALUES (601, 307, N'Table6', 1, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 100000, NULL, NULL, 1473384.00, NULL, NULL, NULL, N'МОСВ, Проектни предложения', NULL, NULL, N'Етапната цел за 2018 г. е определена предвид възможността за изпълнение на проекти, които отговарят на регионалния подход и чието изпълнение може да започне преди приемането на РПИП и на фазирани проекти, чието изпълнение е през два програмни периода. Крайната цел е еквивалент жителите на агломерации, съответстващи на регионалния подход, където са необходими допълнителни инвестиции за постигане на съответствие с изискванията на Директива 91/271/ЕЕО.')
INSERT INTO [MapNodeIndicators] ([MapNodeId], [IndicatorId], [Type], [RegionCategory], [FinanceSource], [BaseTotalValue], [BaseMenValue], [BaseWomenValue], [BaseQualitativeValue], [BaseYear], [TargetTotalValue], [TargetMenValue], [TargetWomenValue], [TargetQualitativeValue], [MilestoneTargetTotalValue], [MilestoneTargetMenValue], [MilestoneTargetWomenValue], [FinalTargetTotalValue], [FinalTargetMenValue], [FinalTargetWomenValue], [MeasureId], [DataSource], [ReportingFrequancy], [CommonBaseIndicator], [Description]) VALUES (601, 374, N'Table6', 1, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 169764705.88, NULL, NULL, 1196318599.00, NULL, NULL, NULL, N'Сертифициращ орган', NULL, NULL, N'Етапната цел е определена на база възможността за изпълнение на проекти в два програмни периода (фазирани проекти); на проекти, които отговарят на регионалния подход и чието изпълнение може да започне преди приемането на РПИП; мерки, свързани с мониторинг на водите до 2018 г; подготовка на РПИП. Етапната цел отчита и натрупания опит от програмен период 2007-2013 г.')
INSERT INTO [MapNodeIndicators] ([MapNodeId], [IndicatorId], [Type], [RegionCategory], [FinanceSource], [BaseTotalValue], [BaseMenValue], [BaseWomenValue], [BaseQualitativeValue], [BaseYear], [TargetTotalValue], [TargetMenValue], [TargetWomenValue], [TargetQualitativeValue], [MilestoneTargetTotalValue], [MilestoneTargetMenValue], [MilestoneTargetWomenValue], [FinalTargetTotalValue], [FinalTargetMenValue], [FinalTargetWomenValue], [MeasureId], [DataSource], [ReportingFrequancy], [CommonBaseIndicator], [Description]) VALUES (601, 305, N'Table6', 1, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, NULL, NULL, 18.00, NULL, NULL, NULL, N'МОСВ, доклади за напредък', NULL, NULL, N'Етапната стойност представлява броя на програмите за мониторинг, които ще бъдат разработени/актуализирани за целите на вторите ПУРБ. Целевата стойност включва 10-те програми за мониторинг за целите на вторите ПУРБ и 8 документа, които ще бъдат разработени/актуализирани за целите на третите ПУРБ 2021-2027 г.')
